    services are solely to help the committee comply with federal campaign finance
    laws; and, because the individuals performing the services are regular employees
    of the organization consistent with Commission regulations at 100.86.  The value
    of those services is $6500.  This amendment is prompted by an audit conducted
    by the Kelley  Drye and Warren PAC.  Three contributions received on 12/24/2007
    were not properly reported.  Accordingly, this amendment reflects those receipts.
    \ In addition a bank fee of $26.99 was not properly reported as occuring on October
    25, 2007.  Additionally, a administrative overhead fee of $2.45 was not reported.
    Those administrative error has been corrected."
